description: >-
  Dominican Bachata from the source!


  Mark your calendars for 1 June 2024 - it will be hot �

  Isolde is known for her improvising dance videos and bachata tutorials with Adam Taub, both which has inspired thousands around the world to learn the dance. She’s often referred and listed as the quintessential example of how bachata is danced, with a representation of it’s complex simplicity and praised for her natural and effortless dominican flow.


  As a teacher she goes out of her way to bring the students the tools to develop a natural flow to their foundation, add flavor to their movements, get a deeper musical understanding and grow a stronger connection to their creative dancing. She’s looking forward to share her knowledge with you! Ya tu sabe, no te lo pierdas! Dominican Bachata straight from the source in the Dominican Republic!
